import './Form.css';

// Form input field compont 
export default function RetuRnForm() {
 return (
  <div className='wrp-form'>

   <div class="container">


    <h1 class="fs-5 mb-4">Ajouter ou editer un membre</h1>

    <form action="">


     <div class="row">


      <div class="col-12 col-md-6 mb-3">
       <label for="name">Nom</label>
       <input type="text" id="name" name="name" class="input" />
      </div>





      <div class="col-12">
       <button class="btn-core w-100" id='print-button' type="submit">Sauvegarder</button>


      </div>
     </div>

    </form>
   </div>




  </div>
 );
}
